import React from 'react';

function Quickplay(props) {
  const { profile } = props;

  const best = profile.quickPlayStats.careerStats.allHeroes.best;

  return (
    <div className="Quickplay">
      <h1>Quickplay Stats</h1>
      <div className="best">
        <h2>Best</h2>
        <ul>
          <li>ALL DAMAGE: {best.allDamageDoneMostInGame}</li>
          <li>All Damage Done Most In Game: {best.allDamageDoneMostInGame}</li>
        </ul>
      </div>
    </div>
  );
}

export default Quickplay;
